#include "GLFont.h"

#include <string.h>

extern unsigned char myFont[];

GLFont::GLFont(){
  m_TextureFont     = 0;
  m_IsReady         = false;
  m_DiplayListBase  = 0;
}

GLFont::~GLFont(){
  Free();
}

void GLFont::LoadFont(){
  if(m_IsReady)
    return;
  
  unsigned char *data = new unsigned char[512*512*2];
  unsigned char *tdata = data;
  unsigned char *tfont = myFont;

  for(int i=0;i<512*512;i++){
    *(tdata++) = *(tfont);
    *(tdata++) = (*(tfont)>0?255:*(tfont));
    tfont++;
  }

  glGenTextures  (1,&m_TextureFont);
  glBindTexture  (GL_TEXTURE_2D, m_TextureFont);
  glTexParameteri(GL_TEXTURE_2D,GL_TEXTURE_MAG_FILTER,GL_LINEAR);
	glTexParameteri(GL_TEXTURE_2D,GL_TEXTURE_MIN_FILTER,GL_LINEAR);
	glTexImage2D   (GL_TEXTURE_2D, 0, 2, 512, 512, 0, GL_LUMINANCE_ALPHA, GL_UNSIGNED_BYTE, data);

  delete [] data;

	float	cx,cy;

	m_DiplayListBase = glGenLists(256);
	glBindTexture(GL_TEXTURE_2D, m_TextureFont);
	for(int i=0; i<256; i++){
		cx=float(i%16)/16.0f;
		cy=float(i/16)/16.0f;
		glNewList(m_DiplayListBase+i,GL_COMPILE);
			glBegin(GL_QUADS);
				glTexCoord2f(cx,cy);
				glVertex2i(0,0);
				glTexCoord2f(cx+0.0625f,cy);
				glVertex2i(1,0);
				glTexCoord2f(cx+0.0625f,cy+0.0625f);
				glVertex2i(1,1);
				glTexCoord2f(cx,cy+0.0625f);
				glVertex2i(0,1);
			glEnd();
			glTranslatef(0.6f,0,0);
		glEndList();
	}

  m_IsReady = true;
}

void GLFont::Free()
{
  if(!m_IsReady)
    return;

	glDeleteLists(m_DiplayListBase,256);
  glDeleteTextures(1,&m_TextureFont);
  m_TextureFont     = 0;
  m_DiplayListBase  = 0;
  m_IsReady         = false;
}


void GLFont::Print(const char *string, int maxLen){
  if(!m_IsReady)
    LoadFont();

  int len = strlen(string);
  if(maxLen>=0){
    len = (maxLen<len?maxLen:len);
  }

  glColor4f(1.0f,1.0f,1.0f,1.0f);
	glBindTexture(GL_TEXTURE_2D, m_TextureFont);
	glDisable(GL_DEPTH_TEST);
	glListBase(m_DiplayListBase-32);
	glCallLists(len,GL_BYTE,string);
	glEnable(GL_DEPTH_TEST);
  glBindTexture(GL_TEXTURE_2D, 0);
}

